    ButtonPressDirective,
    /*---------Chapter 9------------*/

    /*---------Chapter 10------------*/
    Chapter10_1_Component,

    /*---------Chapter 11------------*/
    Chapter11Component,
    EvenPipe,

    /*---------Chapter 12------------*/
    Chapter12Component,
    Chapter121Component,
    Chapter124Component,

    /*---------Chapter 14------------*/
    TableComponentComponent,
    DynamicPipe,
    CountdownPipe,
    TruthyPipe,
    IfDatePipe,
    ReversePipe,
    /*---------Chapter 15------------*/
    HeroComponent,
    OrderBy,
    DasboardComponent,
    Chapter16Component,
    /*---------Chapter 17------------*/
    Chapter17Component,
    Chapter17_1Component,
    Chapter17_2Component,

    /* -----------Chapter 18---------- */
